import React, { Component } from 'react'

export default class AddStudent extends Component {
    constructor(){
        super();
        this.state = {
            studentName: '',
            studentDescription: '',
            studentEmail: '',
            studentTags: []
        }
    }

    render() {
        return (
            <div>
                <h3>Dodaj nowego studenta</h3>

                <input type="text"
                    placeholder='Imie'/>

                <input type="text"
                    placeholder='Opis'/>

                <input type="text"
                    placeholder='Email'/>

                <input type="text"
                    placeholder='Tagi'/>

            </div>
        )
    }
}
